const canvas = document.querySelector('#canvas1');
const ctx = canvas.getContext("2d");

const png = new Image();
let scale = 1;
png.src = "data:image/png;base64,";

// let scale = 2;
// png.src = "data:image/png;base64,";



// ctx.fillStyle = "blue";
