//add again if ever able to interact with smaller window
document.querySelector('.container').addEventListener('transitionend', e => {
    if (document.querySelector('.container').classList.contains('scale')) {
        scale = 1;
    } else {
        scale = 1.25;
    }
})



// canvas.width = 400 * scale;
// canvas.height = 400 * scale;
canvas.width = 400;
canvas.height = 400;
let particleArray =  [];

//mouse
let mouse = {
    x: null,
    y: null,
    radius: 100
}
//offset mouse placements here
window.addEventListener('mousemove', e => {
    let rect = canvas.getBoundingClientRect();
    mouse.x = e.clientX * scale - rect.left * scale;
    mouse.y = e.clientY * scale - rect.top * scale;

    // mouse.x = e.x + canvas.clientLeft/2;
    // mouse.y = e.y + canvas.clientTop/2;
});

let drawImage = () => {
    let imageWidth = png.width;
    let imageHeight = png.height;
    const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    class Particle {
        constructor(x, y, color, size) {
            this.x = x + canvas.width/2 - png.width * 2,
            this.y = y + canvas.height/2 - png.height * 2,
            this.color = color,
            this.size = 2.15,
            this.baseX = x + canvas.width/2 - png.width * 2,
            this.baseY  = y + canvas.height/2 - png.height * 2,
            this.density = (Math.random() * 10) + 2;
        }
        draw() {
            ctx.beginPath();
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.closePath();
            ctx.fill();
        }
        update() {
            ctx.fillStyle = this.color;

            //collision detection
            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx * dx + dy * dy);
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;

            //max distance, past that the force will be 0
            const maxDistance = 100;
            let force = (maxDistance - distance) / maxDistance;
            if (force < 0) force = 0;

            let directionX = (forceDirectionX * force * this.density * .6 * scale);
            let directionY = (forceDirectionY * force * this.density * .6 * scale);

            if (distance < mouse.radius + this.size) {
                this.x -= directionX;
                this.y -= directionY;
            } else {
                if (this.x !== this.baseX) {
                    let dx = this.x - this.baseX;
                    this.x -= dx/20;
                }
                if (this.y !== this.baseY) {
                    let dy = this.y - this.baseY;
                    this.y -= dy/20;
                }
            }
            this.draw();
        }
    }
    let init = () => {
        particleArray = [];

        for (let y = 0, y2 = data.height; y < y2; y++) {
            for (let x = 0, x2 = data.width; x < x2; x++) {
                if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 128) {
                    let positionX = x;
                    let positionY = y;
                    let color = "rgb(" + data.data[(y * 4 * data.width) + (x * 4)] + "," +
                                        data.data[(y * 4 * data.width) + (x * 4) + 1] + "," +
                                        data.data[(y * 4 * data.width) + (x * 4) + 2] + ")";
                    // if (color = "rgb(0,0,0)") {
                    //     color = "rgba(0,0,0,0)"
                    // };
                    particleArray.push(new Particle(positionX * 4, positionY * 4, color));
                }
            }
        }
    }
    let animate = () => {
        requestAnimationFrame(animate);

        ctx.globalAlpha = .25;           // fade rate -> 1 = no trails, 0.1 = heavy trails
        ctx.globalCompositeOperation = "destination-out"  // fade out destination pixels
        // ctx.fillStyle = "rgba(255, 255, 255, 0.1)";
        ctx.fillRect(0,0,innerWidth, innerHeight);
        ctx.globalCompositeOperation = "source-over"
        ctx.globalAlpha = 1; 




        for (let i = 0; i < particleArray.length; i++) {
            particleArray[i].update();
        }
    }
    init();
    animate();

    window.addEventListener('resize', () => {
        // canvas.width = innerWidth;
        // canvas.height = innerHeight;
        canvas.width = 400;
        canvas.height = 400;
        // canvas.width = 400 * scale;
        // canvas.height = 400 * scale;
        init();
    });
}


window.addEventListener('load', e => {
    console.log('page has loaded');
    // let hRatio = canvas.width / png.width;
    // let vRatio = canvas.height / png.height;
    // let ratio  = Math.max ( hRatio, vRatio );
    // ctx.drawImage(png,0,0, png.width, png.height, 0,0,png.width*ratio, png.height*ratio);
    // ctx.drawImage(png,53,50,100, 100);
    ctx.drawImage(png,0,0);

    drawImage();
});







